projects.css:
.navbar {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px 30px;
  background-color: #333;
}

.navbar-logo, .navbar-links {
  flex: 1;
  text-align: center;
}

.navbar-logo {
  color: #fff;
  font-size: 24px;
}

.navbar-links {
  list-style-type: none;
  padding: 0;
  display: flex;
  gap: 15px;
  justify-content: center;
}

.navbar-link {
  text-decoration: none;
  color: #fff;
  transition: color 0.3s ease;
}

.navbar-link:hover {
  color: #ddd;
}

.container { display: flex; }
.menu-toggle { position: absolute; top: 20px; left: 20px; font-size: 24px; cursor: pointer; display: none; }
.sidebar { width: 200px; height: 100vh; background-color: #2c3e50; padding: 20px 0; }
.sidebar-link { display: block; padding: 10px 20px; color: #ecf0f1; text-decoration: none; transition: background-color 0.3s ease; }
.sidebar-link:hover { background-color: #34495e; }
.content { flex: 1; padding: 20px; }
@media screen and (max-width: 768px) { .menu-toggle { display: block; } .sidebar { width: 0; overflow: hidden; transition: width 0.3s ease; } .sidebar.open { width: 200px; } }

projects.js:
const menuToggle = document.getElementById('menu-toggle');
const sidebar = document.getElementById('sidebar');

menuToggle.addEventListener('click', function() {
  sidebar.classList.toggle('open');
});
